import React from "react";
import Card from "../Card";
import "./style.css";

function CardContainer() {
  return (
    <div className="jumbotron card-container">
      {/* Pass props to Card */}
      <Card {...title=title.login.username}/>
    </div>
  );
}

export default CardContainer;
